function msieversion() {
    var msie = window.navigator.userAgent.indexOf("MSIE ");
    return (msie > 0 || !!navigator.userAgent.match(/Trident.*rv\:11\./));
}

if (msieversion()) {
    window.location = '/uts/noSupport.html';
}

